import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';
import { Gear } from 'react-bootstrap-icons';
import './SummarySection.css';

function SummaryItem({ label, value }) {
  return (
    <div className="d-flex flex-column">
      <small className="text-muted">{label}</small>
      <span>{value}</span>
    </div>
  );
}

function SummarySection() {
  return (
    <Card className="mt-3 mb-4 summary-card">
      <Card.Body className="p-0">
        <ListGroup horizontal className="flex-wrap">
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="Date of birth" value="1975-01-01" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="SSN" value="192213322122" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="Companies" value="4" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="ID Control" value="Partial match on name and date of birth" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="Screening" value="Sanction + SIP found" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 flex-grow-1 flex-shrink-0" style={{flexBasis: '16%'}}>
            <SummaryItem label="Screening monitor" value="Active" />
          </ListGroup.Item>
          <ListGroup.Item className="border-0 d-flex align-items-center justify-content-center" style={{flexBasis: '4%'}}>
            <Gear size={20} className="text-muted" style={{ cursor: 'pointer' }} />
          </ListGroup.Item>
        </ListGroup>
      </Card.Body>
    </Card>
  );
}

export default SummarySection;
